<?php

declare(strict_types=1);

namespace ApeDevDe\MicrosoftGraphSdk\Models;

/**
 * SecurityMailClusterEvidence
 */
class SecurityMailClusterEvidence
{
    /**
     * The clustering logic of the emails inside the cluster.
     */
    private ?string $clusterBy;

    /**
     * The value utilized to cluster the similar emails.
     */
    private ?string $clusterByValue;

    /**
     * Count of emails in the email cluster.
     */
    private ?float $emailCount;

    /**
     * Unique identifiers for the emails in the cluster, generated by Microsoft 365.
     */
    private ?string $networkMessageIds;

    /**
     * The query used to identify the email cluster.
     */
    private ?string $query;

    /**
     * Uniform resource name (URN) of the automated investigation where the cluster was identified.
     */
    private ?string $urn;

    public function getClusterBy(): ?string
    {
        return $this->clusterBy;
    }

    public function setClusterBy(?string $clusterBy): self
    {
        $this->clusterBy = $clusterBy;
        return $this;
    }

    public function getClusterByValue(): ?string
    {
        return $this->clusterByValue;
    }

    public function setClusterByValue(?string $clusterByValue): self
    {
        $this->clusterByValue = $clusterByValue;
        return $this;
    }

    public function getEmailCount(): ?float
    {
        return $this->emailCount;
    }

    public function setEmailCount(?float $emailCount): self
    {
        $this->emailCount = $emailCount;
        return $this;
    }

    public function getNetworkMessageIds(): ?string
    {
        return $this->networkMessageIds;
    }

    public function setNetworkMessageIds(?string $networkMessageIds): self
    {
        $this->networkMessageIds = $networkMessageIds;
        return $this;
    }

    public function getQuery(): ?string
    {
        return $this->query;
    }

    public function setQuery(?string $query): self
    {
        $this->query = $query;
        return $this;
    }

    public function getUrn(): ?string
    {
        return $this->urn;
    }

    public function setUrn(?string $urn): self
    {
        $this->urn = $urn;
        return $this;
    }

}
